    color: "yellow"
  },
  {
    label: "Pellegrino",
    value: 9,
    tooltipValue: "Pellegrino is best",
    color: "tan"
  },
  {
    label: "Pellegrino",
    value: 9,
    tooltipValue: "Pellegrino is best",
    color: "navy"
  }
];
function sortArray(data, key) {
  let newArr = data.sort((a, b) => {
    if (a[key] < b[key]) {
      return 1;
    } else if (a[key] > b[key]) {
      return -1;
    } else {
      return 0;
    }
  });
  return newArr;
}
export function createChartData() {
  return sortArray(preChartData, "value");
}
